CREATE TABLE `iot_warehouse` (
  `warehouse_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '仓库编号',
  `warehouse_name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '仓库名称',
  `location` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '仓库区域位置',
  `capacity` int(11) DEFAULT NULL COMMENT '仓库容量（单位：立方米）',
  `temperature` decimal(5,2) DEFAULT NULL COMMENT '仓库温度（单位：摄氏度）',
  `humidity` decimal(5,2) DEFAULT NULL COMMENT '仓库湿度（单位：百分比）',
  `oxygen_level` decimal(5,2) DEFAULT NULL COMMENT '氧气含量（单位：百分比）',
  `nitrogen_level` decimal(5,2) DEFAULT NULL COMMENT '氮气含量（单位：百分比）',
  `is_fire` tinyint(1) DEFAULT '0' COMMENT '是否火灾（TRUE表示有火灾，FALSE表示无火灾）',
  `last_updated` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`warehouse_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='仓库管理表';
