:\"0\",\"updateBy\":\"admin\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2025-04-18 12:55:47',9),(780,'角色管理',2,'com.iams.web.controller.system.SysRoleController.edit()','PUT',1,'admin','研发部门','/system/role','127.0.0.1','内网IP','{\"admin\":false,\"createTime\":\"2025-04-14 12:37:38\",\"dataScope\":\"1\",\"delFlag\":\"0\",\"deptCheckStrictly\":true,\"flag\":false,\"menuCheckStrictly\":true,\"menuIds\":[2006,2052,2100,2094,2095,2096,2097,2098,2099,2115,2067,2071,2072,2068,2141],\"params\":{},\"roleId\":3,\"roleKey\":\"commonUser\",\"roleName\":\"普通员工\",\"roleSort\":3,\"status\":\"0\",\"updateBy\":\"admin\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2025-04-18 12:57:33',10),(781,'文档信息',1,'com.iams.manage.controller.DocumentController.add()','POST',1,'admin','研发部门','/manage/document','127.0.0.1','内网IP','{\"archiveId\":2,\"authenticity\":1,\"availability\":1,\"content\":\"<p>李四心理健康评估报告\\n一、基本信息\\n1.姓名：李四\\n2.性别：[填写性别]\\n3.年龄：[填写年龄]\\n4.职业：[填写职业]\\n5.联系方式：[填写联系方式]\\n6.评估日期：[具体日期]\\n二、评估背景\\n李四因近期工作压力较大，自述出现睡眠障碍、情绪低落等情况，主动寻求心理健康评估，\\n以了解自身心理健康状况，缓解心理压力，改善生活质量。同时，其家人也观察到他在日常\\n生活中表现出注意力不集中、缺乏兴趣等症状，为了全面、准确地评估李四的心理健康水平，\\n制定个性化的干预措施，特开展本次心理健康评估。\\n三、评估方法\\n1.临床访谈：与李四进行深入的面对面交流，了解其成长经历、家庭环境、工作情况、\\n当前心理困扰及症状表现等方面的信息。通过开放式提问，引导李四分享内心感受\\n和想法，建立良好的信任关系，获取全面、详细的主观资料。\\n2.心理测评量表\\n症状自评量表(SCL-90):该量表包含90个项目，涉及感觉、思维、情感、\\n行为、人际关系、生活习惯等多个维度，用于评估个体在躯体化、强迫症状、\\n人际关系敏感、抑郁、焦虑等方面的心理症状程度。\\n。抑郁自评量表(SDS):主要用于衡量个体抑郁情绪的严重程度，通过对被试\\n者在情绪低落、兴趣减退、睡眠障碍等方面的症状表现进行评分，判断其是\\n否存在抑郁倾向及抑郁程度。\\n。焦虑自评量表(SAS):评估个体焦虑情绪的状态和程度，从紧张、担忧、恐\\n惧等方面进行测量，为判断焦虑症状提供依据。\\n3.观察法：在访谈过程中，观察李四的外貌、表情、言语表达、肢体动作、情绪状态\\n等非言语行为，以及与他人的互动方式，获取客观的行为信息，辅助评估其心理健\\n康状况。\\n四、评估内容\\n(一)成长经历与家庭环境\\n李四成长于一个普通家庭，父母关系较为融洽，但父母对其期望较高，在学习和生活方面要\\n求严格。在成长过程中，李四为了满足父母的期望，努力学习，形成了追求完美的性格特点。\\n然而，长期的压力也使他在面对失败时容易产生自我怀疑和焦虑情绪。家庭环境中，父母对\\n情感表达相对含蓄，李四在遇到困难和挫折时，缺乏有效的情感支持和沟通渠道，这在一定\\n程度上影响了他的情绪调节能力。\\n(二)工作情况\\n李四目前从事[具体工作]，工作强度较大，工作任务繁重且时间紧迫。近期，由于公司项目\\n推进困难，李四面临着巨大的工作压力，需要长时间加班完成任务。工作中的人际关系也较\\n为复杂，与同事之间存在一定的竞争关系，沟通协作不够顺畅，这进一步加重了他的心理负\\n担。长期的工作压力导致他出现了职业倦怠的症状，对工作的热情和积极性逐渐降低。\\n(三)当前心理困扰及症状表现\\n1.情绪方面：李四近期情绪低落明显，经常感到沮丧、无助，对原本感兴趣的事情也\\n提不起兴趣。情绪波动较大，容易因一些小事而发脾气，事后又感到后悔和自责。</p>\",\"directory\":10,\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/李四的医疗档案/实验室检查报告/6801f5fcbc33cd713bb3ddec.pdf\",\"fileSize\":394,\"fileType\":\"pdf\",\"id\":34,\"integrity\":1,\"name\":\"李四心理健康评估报告.pdf\",\"params\":{},\"security\":1,\"xuhao\":21}','34',0,NULL,'2025-04-18 14:49:57',505),(782,'档案列表',2,'com.iams.manage.controller.ArchiveController.addDirectoryFiles()','PUT',1,'admin','研发部门','/manage/archive/directory','127.0.0.1','内网IP','{\"archiveId\":2,\"authenticity\":1,\"availability\":1,\"content\":\"<p>李四心理健康评估报告\\n一、基本信息\\n1.姓名：李四\\n2.性别：[填写性别]\\n3.年龄：[填写年龄]\\n4.职业：[填写职业]\\n5.联系方式：[填写联系方式]\\n6.评估日期：[具体日期]\\n二、评估背景\\n李四因近期工作压力较大，自述出现睡眠障碍、情绪低落等情况，主动寻求心理健康评估，\\n以了解自身心理健康状况，缓解心理压力，改善生活质量。同时，其家人也观察到他在日常\\n生活中表现出注意力不集中、缺乏兴趣等症状，为了全面、准确地评估李四的心理健康水平，\\n制定个性化的干预措施，特开展本次心理健康评估。\\n三、评估方法\\n1.临床访谈：与李四进行深入的面对面交流，了解其成长经历、家庭环境、工作情况、\\n当前心理困扰及症状表现等方面的信息。通过开放式提问，引导李四分享内心感受\\n和想法，建立良好的信任关系，获取全面、详细的主观资料。\\n2.心理测评量表\\n症状自评量表(SCL-90):该量表包含90个项目，涉及感觉、思维、情感、\\n行为、人际关系、生活习惯等多个维度，用于评估个体在躯体化、强迫症状、\\n人际关系敏感、抑郁、焦虑等方面的心理症状程度。\\n。抑郁自评量表(SDS):主要用于衡量个体抑郁情绪的严重程度，通过对被试\\n者在情绪低落、兴趣减退、睡眠障碍等方面的症状表现进行评分，判断其是\\n否存在抑郁倾向及抑郁程度。\\n。焦虑自评量表(SAS):评估个体焦虑情绪的状态和程度，从紧张、担忧、恐\\n惧等方面进行测量，为判断焦虑症状提供依据。\\n3.观察法：在访谈过程中，观察李四的外貌、表情、言语表达、肢体动作、情绪状态\\n等非言语行为，以及与他人的互动方式，获取客观的行为信息，辅助评估其心理健\\n康状况。\\n四、评估内容\\n(一)成长经历与家庭环境\\n李四成长于一个普通家庭，父母关系较为融洽，但父母对其期望较高，在学习和生活方面要\\n求严格。在成长过程中，李四为了满足父母的期望，努力学习，形成了追求完美的性格特点。\\n然而，长期的压力也使他在面对失败时容易产生自我怀疑和焦虑情绪。家庭环境中，父母对\\n情感表达相对含蓄，李四在遇到困难和挫折时，缺乏有效的情感支持和沟通渠道，这在一定\\n程度上影响了他的情绪调节能力。\\n(二)工作情况\\n李四目前从事[具体工作]，工作强度较大，工作任务繁重且时间紧迫。近期，由于公司项目\\n推进困难，李四面临着巨大的工作压力，需要长时间加班完成任务。工作中的人际关系也较\\n为复杂，与同事之间存在一定的竞争关系，沟通协作不够顺畅，这进一步加重了他的心理负\\n担。长期的工作压力导致他出现了职业倦怠的症状，对工作的热情和积极性逐渐降低。\\n(三)当前心理困扰及症状表现\\n1.情绪方面：李四近期情绪低落明显，经常感到沮丧、无助，对原本感兴趣的事情也\\n提不起兴趣。情绪波动较大，容易因一些小事而发脾气，事后又感到后悔和自责。</p>\",\"directory\":10,\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/李四的医疗档案/实验室检查报告/6801f5fcbc33cd713bb3dde