df\",\"params\":{},\"security\":1}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2025-04-18 16:02:09',11),(816,'文档信息',1,'com.iams.manage.controller.DocumentController.add()','POST',1,'admin','研发部门','/manage/document','127.0.0.1','内网IP','{\"archiveId\":1,\"authenticity\":1,\"availability\":1,\"content\":\"<p>基于 Python 的数据分析系统设计与实现\\n·摘要：本研究旨在设计并实现一个基于 Python 的数据分析系统，借助\\nPython 丰富的数据分析库，解决企业在海量数据处理时遇到的难题。研\\n究采用文献研究、案例分析与系统开发相结合的方法，成功开发出具有数\\n据清洗、统计分析和可视化功能的系统，为企业数据处理提供高效工具。\\n·关键词：Python;数据分析系统；数据可视化\\n。正文：\\n·第一章绪论：介绍研究背景、目的、意义与国内外研究现状。\\n·第二章 相关技术基础：阐述 Python 语言特性、常用数据分析库如\\nPandas、Numpy 等。\\n·第三章系统需求分析：通过对企业调研，明确系统功能与性能需求。\\n·第四章系统设计与实现：详细说明系统架构、模块设计与功能实现过程。\\n·第五章系统测试与优化：对系统进行功能、性能测试，并根据测试结果\\n优化系统。\\n·第六章结论与展望：总结研究成果，对未来研究方向提出展望。</p>\",\"directory\":13,\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/毕业论文/6802070ebc33f10bc18cfbe1.pdf\",\"fileSize\":243,\"fileType\":\"pdf\",\"id\":39,\"integrity\":1,\"name\":\"张三毕业论文.pdf\",\"params\":{},\"security\":1}','39',0,NULL,'2025-04-18 16:02:26',62),(817,'档案列表',2,'com.iams.manage.controller.ArchiveController.addDirectoryFiles()','PUT',1,'admin','研发部门','/manage/archive/directory','127.0.0.1','内网IP','{\"archiveId\":1,\"authenticity\":1,\"availability\":1,\"content\":\"<p>基于 Python 的数据分析系统设计与实现\\n·摘要：本研究旨在设计并实现一个基于 Python 的数据分析系统，借助\\nPython 丰富的数据分析库，解决企业在海量数据处理时遇到的难题。研\\n究采用文献研究、案例分析与系统开发相结合的方法，成功开发出具有数\\n据清洗、统计分析和可视化功能的系统，为企业数据处理提供高效工具。\\n·关键词：Python;数据分析系统；数据可视化\\n。正文：\\n·第一章绪论：介绍研究背景、目的、意义与国内外研究现状。\\n·第二章 相关技术基础：阐述 Python 语言特性、常用数据分析库如\\nPandas、Numpy 等。\\n·第三章系统需求分析：通过对企业调研，明确系统功能与性能需求。\\n·第四章系统设计与实现：详细说明系统架构、模块设计与功能实现过程。\\n·第五章系统测试与优化：对系统进行功能、性能测试，并根据测试结果\\n优化系统。\\n·第六章结论与展望：总结研究成果，对未来研究方向提出展望。</p>\",\"directory\":13,\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/毕业论文/6802070ebc33f10bc18cfbe1.pdf\",\"fileSize\":243,\"fileType\":\"pdf\",\"id\":39,\"integrity\":1,\"name\":\"张三毕业论文.pdf\",\"params\":{},\"security\":1}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2025-04-18 16:02:26',11),(818,'文档额外信息'