\n·第一章绪论：介绍研究背景、目的、意义与国内外研究现状。\\n·第二章 相关技术基础：阐述 Python 语言特性、常用数据分析库如\\nPandas、Numpy 等。\\n·第三章系统需求分析：通过对企业调研，明确系统功能与性能需求。\\n·第四章系统设计与实现：详细说明系统架构、模块设计与功能实现过程。\\n·第五章系统测试与优化：对系统进行功能、性能测试，并根据测试结果\\n优化系统。\\n·第六章结论与展望：总结研究成果，对未来研究方向提出展望。\",\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5ac699fbb5bc19d6e2d8\",\"fileSize\":243,\"fileType\":\"pdf\",\"id\":51,\"name\":\"张三毕业论文.pdf\",\"params\":{}}','51',0,NULL,'2025-05-08 15:18:31',99),(881,'文档信息',1,'com.iams.manage.controller.DocumentController.add()','POST',1,'admin','研发部门','/manage/document','127.0.0.1','内网IP','{\"archiveId\":1,\"content\":\"\",\"filePath\":\"http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5ad999fbb5bc19d6e2d9\",\"fileSize\":1293,\"fileType\":\"mp4\",\"id\":52,\"name\":\"演示视频.mp4\",\"params\":{}}','52',0,NULL,'2025-05-08 15:18:49',102),(882,'档案列表',2,'com.iams.manage.controller.ArchiveController.batchMount()','POST',1,'admin','研发部门','/manage/archive/batch-mount','127.0.0.1','内网IP','{\"docIds\":{\"docIds\":[49,50,51],\"directoryId\":3}}','{\"msg\":\"操作成功\",\"code\":200,\"data\":1}',0,NULL,'2025-05-08 15:19:57',374),(883,'菜单管理',1,'com.iams.web.controller.system.SysMenuController.add()','POST',1,'admin','研发部门','/system/menu','127.0.0.1','内网IP','{\"children\":[],\"component\":\"manage/seal/index\",\"createBy\":\"admin\",\"icon\":\"文档管理\",\"isCache\":\"0\",\"isFrame\":\"1\",\"menuName\":\"档案章管理\",\"menuType\":\"C\",\"orderNum\":10,\"params\":{},\"parentId\":2006,\"path\":\"seal\",\"status\":\"0\",\"visible\":\"0\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2025-05-09 17:02:01',23),(884,'菜单管理',2,'com.iams.web.controller.system.SysMenuController.edit()','PUT',1,'admin','研发部门','/system/menu','127.0.0.1','内网IP','{\"children\":[],\"component\":\"manage/seal/index\",\"createTime\":\"2025-05-09 17:02:01\",\"icon\":\"文档管理\",\"isCache\":\"0\",\"isFrame\":\"1\",\"menuId\":2144,\"menuName\":\"档案章管理\",\"menuType\":\"C\",\"orderNum\":10,\"params\":{},\"parentId\":2006,\"path\":\"seal\",\"perms\":\"mana