CREATE TABLE `tb_archive` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `danghao` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '档号',
  `name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '档案名称',
  `rfid` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '射频标签号',
  `jianhao` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '件号',
  `secret_level` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '保密级别',
  `secret_peroid` varchar(16) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '保密期限',
  `desecret_date` date DEFAULT NULL COMMENT '解密日期',
  `retention_period` varchar(16) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '保管期限',
  `carrier_type` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '载体类型',
  `start_date` date DEFAULT NULL COMMENT '起始时间',
  `end_date` date DEFAULT NULL COMMENT '终止时间',
  `guidang_time` timestamp NULL DEFAULT NULL COMMENT '归档时间',
  `shiti_location` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '实体档案位置',
  `dianzi_location` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电子档案位置',
  `directory` json DEFAULT NULL COMMENT '档案目录',
  `description` text COLLATE utf8mb4_unicode_ci COMMENT '档案简介',
  `formation_unit` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '形成单位',
  `transfer_unit` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '移交单位',
  `document_count` int(11) DEFAULT NULL COMMENT '文件(档)数量',
  `status` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '档案状态',
  `authenticity` tinyint(1) DEFAULT '1' COMMENT '真实性',
  `integrity` tinyint(1) DEFAULT '1' COMMENT '完整性',
  `availability` tinyint(1) DEFAULT '1' COMMENT '可用性',
  `security` tinyint(1) DEFAULT '1' COMMENT '安全性',
  `category_id` int(11) DEFAULT NULL COMMENT '档案门类',
  `fonds_id` int(11) DEFAULT NULL COMMENT '档案全宗',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '修改人',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `extra_info` json DEFAULT NULL COMMENT '文档额外信息',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `fk_category_id` (`category_id`) USING BTREE,
  KEY `fk_fonds_id` (`fonds_id`) USING BTREE,
