DROP TABLE IF EXISTS `tb_document`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_document` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `archive_id` int(11) DEFAULT NULL COMMENT '所属档案',
  `xuhao` int(11) DEFAULT NULL COMMENT '目录内序号',
  `name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文件名称',
  `file_type` varchar(16) COLLATE utf8mb4_unicode_ci DEFAULT 'pdf' COMMENT '文件类型',
  `file_size` int(11) DEFAULT NULL COMMENT '文件大小(Kb)',
  `file_path` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '文件路径',
  `file_location` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '存放位置',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '文件内容',
  `authenticity` tinyint(1) DEFAULT '1' COMMENT '真实性',
  `integrity` tinyint(1) DEFAULT '1' COMMENT '完整性',
  `availability` tinyint(1) DEFAULT '1' COMMENT '可用性',
  `security` tinyint(1) DEFAULT '1' COMMENT '安全性',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '修改人',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `directory` int(11) DEFAULT NULL COMMENT '所在目录',
  `extra_info` json DEFAULT NULL COMMENT '文档额外信息',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='文档信息表';
/*!40101 SET character_set_client = @saved_cs_client */;

