的学籍档案/个人信息表/680206fdbc33f10bc18cfbe0.pdf',NULL,'<p>学生基本信息表\n信息类别\n详情\n姓名\n张三\n性别\n男\n出生日期\n2004年9月10日\n民族\n汉族\n籍贯\n河南省郑州市\n政治面貌\n共青团员\n联系方式\n138xxxx5678\n电子邮箱\nzhangsan@example.com\n·教育背景：\n2010年9月-2016\n年6月，郑州市文化\n路第一小学\n2016年9月-2019\n年6月，郑州市第八\n中学\n2019年9月-2022\n年6月，郑州市第一\n中学\n·家庭信息：\n父亲：张建国，企业\n职工，139xxxx8901\n母亲：李芳，教师，\n136xxxx2345</p>',1,1,1,1,'2025-04-18 08:02:09',NULL,'2025-04-18 08:02:09',NULL,NULL,2,NULL),(39,1,NULL,'张三毕业论文.pdf','pdf',243,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/毕业论文/6802070ebc33f10bc18cfbe1.pdf',NULL,'<p>基于 Python 的数据分析系统设计与实现\n·摘要：本研究旨在设计并实现一个基于 Python 的数据分析系统，借助\nPython 丰富的数据分析库，解决企业在海量数据处理时遇到的难题。研\n究采用文献研究、案例分析与系统开发相结合的方法，成功开发出具有数\n据清洗、统计分析和可视化功能的系统，为企业数据处理提供高效工具。\n·关键词：Python;数据分析系统；数据可视化\n。正文：\n·第一章绪论：介绍研究背景、目的、意义与国内外研究现状。\n·第二章 相关技术基础：阐述 Python 语言特性、常用数据分析库如\nPandas、Numpy 等。\n·第三章系统需求分析：通过对企业调研，明确系统功能与性能需求。\n·第四章系统设计与实现：详细说明系统架构、模块设计与功能实现过程。\n·第五章系统测试与优化：对系统进行功能、性能测试，并根据测试结果\n优化系统。\n·第六章结论与展望：总结研究成果，对未来研究方向提出展望。</p>',1,1,1,1,'2025-04-18 08:02:26',NULL,'2025-04-18 08:03:47',NULL,NULL,13,'[{\"label\": \"题目\", \"value\": \"<p>基于Python的数据分析系统设计与实现</p>\"}]'),(41,2,21,'李四心理健康评估报告.pdf','pdf',394,'http://127.0.0.1:8080/profile/file/全宗一/李四的医疗档案/诊断报告/680211e8bc33f10bc18cfbe3.pdf',NULL,'<p>李四心理健康评估报告\n一、基本信息\n1.姓名：李四\n2.性别：[填写性别]\n3.年龄：[填写年龄]\n4.职业：[填写职业]\n5.联系方式：[填写联系方式]\n6.评估日期：[具体日期]\n二、评估背景\n李四因近期工作压力较大，自述出现睡眠障碍、情绪低落等情况，主动寻求心理健康评估，\n以了解自身心理健康状况，缓解心理压力，改善生活质量。同时，其家人也观察到他在日常\n生活中表现出注意力不集中、缺乏兴趣等症状，为了全面、准确地评估李四的心理健康水平，\n制定个性化的干预措施，特开展本次心理健康评估。\n三、评估方法\n1.临床访谈：与李四进行深入的面对面交流，了解其成长经历、家庭环境、工作情况、\n当前心理困扰及症状表现等方面的信息。通过开放式提问，引导李四分享内心感受\n和想法，建立良好的信任关系，获取全面、详细的主观资料。\n2.心理测评量表\n症状自评量表(SCL-90):该量表包含90个项目，涉及感觉、思维、情感、\n行为、人际关系、生活习惯等多个维度，用于评估个体在躯体化、强迫症状、\n人际关系敏感、抑郁、焦虑等方面的心理症状程度。\n。抑郁自评量表(SDS):主要用于衡量个体抑郁情绪的严重程度，通过对被试\n者在情绪低落、兴趣减退、睡眠障碍等方面的症状表现进行评分，判断其是\n否存在抑郁倾向及抑郁程度。\n。焦虑自评量表(SAS):评估个体焦虑情绪的状态和程度，从紧张、担忧、恐\n惧等方面进行测量，为判断焦虑症状提供依据。\n3.观察法：在访谈过程中，观察李四的外貌、表情、言语表达、肢体动作、情绪状态\n等非言语行为，以及与他人的互动方式，获取客观的行为信息，辅助评估其心理健\n康状况。\n四、评估内容\n(一)成长经历与家庭环境\n李四成长于一个普通家庭，父母关系较为融洽，但父母对其期望较高，在学习和生活方面要\n求严格。在成长过程中，李四为了满足父母的期望，努力学习，形成了追求完美的性格特点。\n然而，长期的压力也使他在面对失败时容易产生自我怀疑和焦虑情绪。家庭环境中，父母对\n情感表达相对含蓄，李四在遇到困难和挫折时，缺乏有效的情感支持和沟通渠道，这在一定\n程度上影响了他的情绪调节能力。\n(二)工作情况\n李四目前从事[具体工作]，工作强度较大，工作任务繁重且时间紧迫。近期，由于公司项目\n推进困难，李四面临着巨大的工作压力，需要长时间加班完成任务。工作中的人际关系也较\n为复杂，与同事之间存在一定的竞争关系，沟通协作不够顺畅，这进一步加重了他的心理负\n担。长期的工作压力导致他出现了职业倦怠的症状，对工作的热情和积极性逐渐降低。\n(三)当前心理困扰及症状表现\n1.情绪方面：李四近期情绪低落明显，经常感到沮丧、无助，对原本感兴趣的事情也\n提不起兴趣。情绪波动较大，容易因一些小事而发脾气，事后又感到后悔和自责。</p>',1,1,1,1,'2025-04-18 08:49:08',NULL,'2025-04-18 09:05:03',NULL,NULL,7,NULL),(47,1,NULL,'演示视频.mp4','mp4',1293,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/学生基本信息/681c5a9299fbb5bc19d6e2d4','admin',NULL,0,0,0,0,'2025-05-08 07:17:41',NULL,'2025-05-08 07:17:41',NULL,NULL,1,NULL),(48,1,NULL,'第一学期考试安排.pdf','pdf',98,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5abf99fbb5bc19d6e2d5',NULL,'考试科目\n考试时间\n考试地点\n高等数学\n2023年1月10日9：00\n1号教学楼301室\n-11:00\n大学英语\n2023年1月12日14：00\n1号教学楼302室\n-16:00',1,1,1,1,'2025-05-08 07:18:25',NULL,'2025-05-08 07:18:25',NULL,NULL,NULL,NULL),(49,1,NULL,'入学登记表.pdf','pdf',99,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5ac299fbb5bc19d6e2d6',NULL,'大学入学登记表\n项目\n详情\n入学年份\n2022年\n录取专业\n计算机科学与技术\n录取批次\n本科一批\n报到时间\n2022年9月1日',1,1,1,1,'2025-05-08 07:18:27',NULL,'2025-05-08 07:19:57',NULL,NULL,3,NULL),(50,1,NULL,'身份证复印件.pdf','pdf',113,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5ac399fbb5bc19d6e2d7',NULL,'身份证复印件模拟示意\n正面\n顶端为国徽图案，下方写有“中华人民共和国居民身份证”，再下方是签发机关“郑州市公安\n局\"，有效期限“2020.01.01-2030.01.01”。\n反面\n左上角是张三免冠彩色照片，右侧依次为：姓名张三、性别男、民族汉族、出生2004年9\n月10日、住址河南省郑州市金水区花园路1号、公民身份号码41010520040910xxxx。',1,1,1,1,'2025-05-08 07:18:29',NULL,'2025-05-08 07:19:57',NULL,NULL,3,NULL),(51,1,NULL,'张三毕业论文.pdf','pdf',243,'http://127.0.0.1:8080/profile/file/全宗一/张三的学籍档案/681c5ac699fbb5bc19d6e2d8',NULL,'基于 Python 的数据分析系统设计与实现\n·摘要：本研究旨在设计并实现一个基于 Python 的数据分析系统，借助\nPython 丰富的数据分析库，解决企业在海量数据处理时遇到的难题。研\n究采用文献研究、案例分析与系统开发相结合的方法，成功开发出具有数\n据清洗、统计分析和可视化功能的系统，为企业数据处理提供高效工具。\n·关键词：Python;数据分析系统；数据可视化\n。正文：\n·第一章绪论：介绍研究背景、目的、意义与国内外研究现状。\n·第二章 相关