CREATE TABLE `tb_watermark` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '水印ID',
  `content` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '水印文本内容',
  `color` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT 'rgba(235, 2, 2, 0.2)' COMMENT '水印文本颜色',
  `fontsize` int(11) DEFAULT '16' COMMENT '水印文本字体大小',
  `fontweight` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT 'normal' COMMENT '水印文本字重',
