  `fontstyle` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT 'normal' COMMENT '水印文本字体样式',
  `rotate` int(11) DEFAULT '-30' COMMENT '旋转角度',
  `gap_x` int(11) DEFAULT '100' COMMENT '水平间距',
  `gap_y` int(11) DEFAULT '100' COMMENT '垂直间距',
  `offset_x` int(11) DEFAULT '50' COMMENT '水平偏移',
  `offset_y` int(11) DEFAULT '50' COMMENT '垂直偏移',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '修改人',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `default_id` int(11) DEFAULT NULL COMMENT '文档额外信息',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='水印信息表';
